export function getNavPlanDroneImage(color) {
    const img = new Image();
    img.src = getNavPlanDroneImageSrc(color);
    return img;
}

export function getNavPlanImage(type, color) {

    const img = imagesCache.get(`${type}-${color}`);

    if (!img) {
        const img = new Image();
        img.src = getImageByType[type](color);
        imagesCache.set(`${type}-${color}`, img);
    }

    return img;
}
